pub fn alphabet_wordsfi_get_element(n: usize) -> Option<String> {
    if n >= ALPHABET_WORDSFI.len() {
        eprintln!("Error: Attempting to access non-existent charater.");
        process::exit(1);
    }
    let s = ALPHABET_WORDSFI[n].to_string();
    Some(s)
}